@keyframes arrow {
    0% {
        transform: translateY(0);
    }

    7% {
        transform: translateY(-20px);
        opacity: 1;
    }

    10% {
        opacity: 0;
        transform: translateY(20px);
    }

    15%,
    100% {
        transform: translateY(0);
    }
    
    20% {
        opacity: 0;
    }
    
    25% {
        opacity: 1;
    }
}

@keyframes arrow2 {

    0%,
    9% {
        transform: translateY(0);
        opacity: 1;
    }

    15% {
        transform: translateY(20px);
        opacity: 0;
    }

    16% {
        transform: translateY(0);
    }

    30%,
    100% {
        opacity: 1;
    }
}

